    data: |
      SELECT ALL - 3 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( NULL ) NOT BETWEEN 1 + - col2 AND - + 41 - - CAST ( 10 AS INTEGER ) * + 76;
  - name: tab1

outputs:
  - name: q12308.out
    data: |
